DROP TABLE IF EXISTS `mbs_xiaofei`;
CREATE TABLE `mbs_xiaofei` (
  `xiaofei_id` int(11) NOT NULL AUTO_INCREMENT,
  `customer_id` int(11) DEFAULT NULL COMMENT '客户id',
  `customer_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `firvisit` tinyint(4) DEFAULT NULL COMMENT '是否初诊',
  `fromway_id` int(11) DEFAULT NULL COMMENT '来源id',
  `package_id` int(11) DEFAULT NULL COMMENT '诊疗项目id',
  `project_id` int(11) DEFAULT NULL COMMENT '明细id',
  `if_local` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '本店支付 1本店 2借店支付',
  `serchain_id` int(11) NOT NULL COMMENT '服务门店id',
  `xfchain_id` int(11) DEFAULT NULL COMMENT '消费门店id',
  `payway_id` int(11) DEFAULT NULL COMMENT '支付方式id',
  `clean` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '是否结清 1结清 2未结清',
  `owe` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '欠款',
  `jishi_id` int(11) DEFAULT NULL COMMENT '治疗师id',
  `jishi_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `reception_id` int(11) DEFAULT NULL COMMENT '前台接待id',
  `total_money` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '总金额',
  `kaifa_money` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '原始开发金额',
  `xfbeizhu` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '消费备注',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `status` tinyint(4) DEFAULT '1' COMMENT '1有效 0失效',
  PRIMARY KEY (`xiaofei_id`)
) ENGINE=MyISAM AUTO_INCREMENT=39 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='消费基础表';

